import React, { useEffect, useState } from "react";
import './Doctprofile.css';
import axios from "axios";
import { Card, ListGroupItem, ListGroup } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
function Doctprofile() {
    const [person, setperson] = useState(Array);

    useEffect(() => {
        axios.get("http://localhost:5000/doctor")
            .then(res => {
                setperson(res.data.dr);
                console.log(res.data.dr);
            });
    }, [])

    function deletedoct(e) {
        console.log(e.target.id);
    }

    return (
        <div>
            {
                <Card style={{ width: '18rem' }}>
                    <Card.Img variant="top" src={process.env.PUBLIC_URL + '/dr1.jpg'} />
                    <Card.Body>
                        <Card.Title>Card Title</Card.Title>
                        <Card.Text>
                            Some quick example text to build on the card title and make up the bulk of
                            the card's content.
                        </Card.Text>
                    </Card.Body>
                    <ListGroup className="list-group-flush">
                        <ListGroupItem>Cras justo odio</ListGroupItem>
                        <ListGroupItem>Dapibus ac facilisis in</ListGroupItem>
                        <ListGroupItem>Vestibulum at eros</ListGroupItem>
                    </ListGroup>
                </Card>
            }
        </div>
    );
}


export default Doctprofile;
